    "Advanced Capacitors for High-Power Applications Project",nt"tracking_summary":
    {ntt"total": 14,ntt"recent": 4nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:12:42.049243",nt"name": "advanced-capacitors-for-high-power-applications-project",nt"isopen":
    true,nt"url": null,nt"notes": "As the consumer and industrial requirements
    for compact, high-power-density, electrical power systems grow substantially over
    the next decade; there will be a significant need for novel electrode/electrolyte
    materials for high-power/energy-density capacitors.  To meet the strong market demand
    for miniaturization and higher capacitance/voltage values in a given case size,
    new and advanced technologies must be developed and implemented. This proposal addresses
    the development of an all-solid, high-energy-density, high-power-density, high-voltage
    capacitor, with substantially reduced Equivalent Series Resistance (ESR) and cost.
    The proposed capacitor combines the advantages of operating voltage associated with
    certain metal-oxide electrolytic capacitors with some special features of metal-oxide
    pseudocapacitor material. Compared to the standard solid electrolytic capacitor,
    the proposed capacitor design will have a higher capacitance and lower resistance,
    yielding a low-cost, low-ESR device with a simplified packaging process. During
    Phase I prototype capacitor units will be fabricated and characterized to demonstrate
    the feasibility of our approach. These units will be evaluated and compared to standard
    capacitors to evaluate the overall benefit of the hybrid capacitors and success
    in demonstrating concept feasibility.",nt"license_title": "U.S. Government
